" 83 :   private void parse(AbstractCompiler compiler) {
 84 :     try {
 85 :       logger_.fine("Parsing: " + sourceFile.getName());
 86 :       root = ParserRunner.parse(sourceFile, sourceFile.getCode(),
 87 :           compiler.getParserConfig(),
 88 :           compiler.getDefaultErrorReporter(),
 89 :           logger_);
 90 :     } catch (IOException e) {
 91 :       compiler.report(
 92 :           JSError.make(AbstractCompiler.READ_ERROR, sourceFile.getName()));
 93 :     }
 94 : 
 95 :     if (root == null || compiler.hasHaltingErrors()) {
 96 :       // There was a parse error or IOException, so use a dummy block.
 97 :       root = IR.script();
 98 :     } else {
 99 :       compiler.prepareAst(root);
100 :     }
101 : 
102 :     // Set the source name so that the compiler passes can track
103 :     // the source file and module.
104 :     root.setStaticSourceFile(sourceFile);
105 :   }"

